        "uid": "tJebpn7Y8V5S9DreqdB2",
        "description": "You are invited to this Heart Opening Tantra Puja. A Puja is a devotional offering. Through this sacred ceremony we can realize of the true nature of the Self and experience into the state of total oneness.\r\n \r\n This Tantra Puja is a way of honoring and adoring the divine that dwells within each of us. \r\n \r\n What is a Heart Opening Puja? Watch here: https://www.youtube.com/watch?v=osqSdVTIZ_4\r\n \r\n This is a \"station\" puja. There is an inner and outer circle. One rotates and with each rotation you have a new partner. Each partnering is an opportunity to fall in love with ourselves through the eyes of another.\r\n \r\n The stations are subtle, elegantly simple and this is their potency. The tantric arts invite us into our own heart in an ease full way. One of the most exquisite is this ceremony where we open to an embodied experience of witnessing the divine in all and thus the diving in ourselves.\r\n \r\n Open to the possibility of adoration, forgiveness, unconditional love and experiencing your true and higher self in the span of a few short hours.",
