        "title": "Bridges to Another Life",
        "uid": "Qco7NWmHe4Q6H3FNLpgm",
        "description": "\"Exponentially accelerating technology, population and development imply that the vast majority of all technological progress has occurred within living memory, yet the basic template for industrial civilization hasn't changed much since Hiroshima.  Merely tacking organic food and  iPhone apps onto the suburban consumerism of the fifties sells both humanity and technology short.  Rather than leaping into the unknown however, or embracing an interested vision, most people rightly stock with what they know, even as it ceases to inspire, or even to make sense.  \r\n\r\nExperimental communities can showcase the possibilities technology and abundance have made available, preparing the disaffected to make a shift from consumerism to more advanced forms of society. \"",
