        "uid": "xskBQLAauGp6URmGDvGp",
        "description": "Stories: That\u2019s how we have communicated, well I guess as long as we have been able to communicate.  We used stories to pass on information, persuade, and entertain. Stories told by others give us insight into how they think and feel.  When we hear something in a story that we connect with we don\u2019t feel so alone in our own thoughts. Truth is, we are much more likely to remember something if we hear it in a story then just the facts. Humans are social beings and enjoy others for the most part and listing to stories gives us that connection.  But what actually makes up a story? And better yet what makes up a compelling story that engages your audience? Join Writer / Director Robert Hargreaves MFA Screen Writing for this seminar / discussion about Storytelling and Story Tellers. We will be serving Espresso Shots & Cookies",
