        "uid": "YcbFUwQpyCXhvHCToAuX",
        "description": "\"Embodied Intimacy is relational breathing meditation done in full body embrace, cultivating connection by relating with what is here, right now. Utilizing the core tools of Tantra: Breath, Sound, Movement and Touch we are slowing down, and we are being together just as we are. As we slow down and link up breath and sound we create all these exquisite feedback loops- body to body, belly to belly, heart to heart, and we invite each other into more and more presence, trust and relaxation.\r\n\r\nEmbodied Intimacy guides everyone gently from a state of separation and isolation towards safety and oxytocin fueled connection. The result is a simple felt presence, real time intimacy and heartfelt shared truth. The story and drama of the mind subsides and a new level of being is found in its place. In-To-Me-I-See. Sound by Sound, sigh by sigh, breath by breath it all unfolds, melts and unwinds. At the speed of love we learn how to live from the wisdom of our heart instead of the worry of our minds.\r\n\"",
