        "event_id": 18815,
        "title": "The Arts of Buon Fresco Revealed",
        "uid": "GZPpKSKRoUiG5BsMUWSJ",
        "description": "Hi everyone, come and get PLASTERED! ;o)\r\n\r\nWe humbly invite you all to \u201cBecoming the Master/Mistress of Stones: The Arts of Buon Fresco!\u201d\r\n\r\nWelcome to the Burning Man Guild Workshops! For the first time ever, Burning Man is hosting a series of workshops in a Florentine piazza-style format to have Masters of various craftsmanship skills teach our students the arts of the Renaissance. \r\n\r\nWe, The Three Faced (Stone) Wench Workshop/Guild, are offering a series of classes you would love to attend! \r\n\r\nHere\u2019s the scoop:\r\n\r\nApprentices will learn the various actual old time techniques over several days to create a fresco (block) from scratch to take home. As part of our commitment to up-cycle, we will utilize and recycle actual (old foam insulation) building materials. Participants will learn to recreate various historical stone mixtures that compromise the the surfaces of the block, complete with plastering, cartooning, and finally the stages of painting the actual fresco with pigments. This artifact creation will be followed by (and applied) techniques to 'age' their artwork with the patina and craquelure of passing time. The result? A beautiful, yet portable and tangible, aged piece of buon fresco that becomes their momento of inspired learning at Burning Man. ;)\r\n\r\nUpon completing your fresco block, you will receive a Playa Plastered Master of Arts certificate, authorizing you to be plastered anywhere on the playa!\r\n\r\nThat\u2019s not all! \r\n\r\nWe are offering a unique community project/event, and we invite everyone to participate with your hearts (and energy): \r\n\r\nWe are accomplishing a recreation of Gustav Klimt\u2019s Beethoven Frieze (Ode To Joy), with a slight twist on the theme: \u201cAll You Need Is Love.\u201d The secco fresco artwork will stretch across several large panels, a moving tribute of the people lost at Orlando, Florida, and of our experiences at Burning Man. \r\n\r\nPlease join us! ;o)\r\n\r\nYouth ages 12 and up welcome.",
