        "description": "\"What you look for is what you see? If you look for gratitude, you will surely find it. \r\n \r\n Qoya is based on the idea through movement, we remember. We remember our essence is wise, wild and free. Wise, wild and free also draw reference to the movement forms that we practice. Wise- the wisdom of yoga. Wild- the creative expression in dance. Free- expanding our capacity to enjoy being in our bodies through more sensual and feminine flowing movement. In Qoya, there is no way you can do it wrong and the way you know you're doing it right is that it feels good in your body. More than feeling good, is that it feels honest.\"",
