        "title": "Realtime authentic relating games",
        "uid": "CeLYKq2DFqcaBSW6oVte",
        "description": "In this workshop we are going to play a few authentic relating games that center on connection. We stay in the present moment, report on our current experiences, and do our best to stay objective about the observations we make.\r\n \r\n For instance, if we want to only say things that are so objective that a camera could pick up on them, we might say \"I notice your eyes are squinting and I see you are smiling\" instead of \"I see that you are happy\".\r\n \r\n Because we don't know if that person is happy for sure, they could be putting on a face because they are nervous and afraid!",
