        "uid": "E9cGw7ndvEn9HBPxK8bE",
        "description": "Not the kind of fun freaky night you imagined? Things getting a little too weird ...even for Burning Man? The Zendo Project is a place where you can find support during particularly challenging or overwhelming experiences, substance related or otherwise. The Zendo is staffed 24/7 with trained volunteers who offer peer-to-peer counseling support. This is a safe space to land and reconnect with yourself before you head off to your next adventure! We have two locations on D at the 9:00 and 3:00 keyholes. We are open all week, from 8pm on Monday the 29th until 8am on Monday the 5th. If you or a friend are in need of support, come find the Zendo!\r\n\r\nMission\r\nThe mission of the Zendo Project is to provide a supportive environment and education to help transform difficult psychedelic and psychological experiences into opportunities for learning and growth.\r\n \r\nVision\r\nWe envision a world where communities are engaged in providing safety and support for people having psychedelic and psychological challenges; and harm reduction principles are used foremost to reduce the risks associated with substance use.",
