        "description": "Now that Burning Man has become a maker fair under the aegis of the Renaissance Faire, there is a lot more than the usual dust up over the direction and identity of this quaint event in the Nevada desert. This year\u2019s dust shall be comprised of marble, sandstone, oak, and pewter, a highly controversial mixture never before introduced to the Black Rock desert. Because they don\u2019t mess around when it comes to preserving intact the native chemical profile of the immediate environment of the Black Rock desert, the Bureau of Land Management has mandated extra precautions for 2016. As such, the BLM has required that BMOrg retain the services of the French Maid Brigade. It\u2019s nothing we wouldn\u2019t be doing anyway. \r\n\r\nRendezvous with us! You too can be one of the sexiest clean freaks on the playa\u2014please bring: feather dusters, rags, dustbusters, service carts, vacuums, white gloves, latex gloves, enema kits, lube, and any other useful cleaning equipment. Join us in uniform with your surly attitude and worst possible French accent.\r\n\r\nOn Thursday at 2:00 pm we meet at 3 O\u2019Clock and Esplanade then dust our way through every filthy, nasty camp on our march toward that dust bucket known as Center Camp Caf\u00e9, liberate them from their dusty oppression, and celebrate our triumph!",
