        "title": "The Art of Flow: The Key to Effortless Living",
        "uid": "zCge7WZZNm9ASwwSqvTV",
        "description": "\"In this deeply transformational, interactive workshop, Jackie and Justin will be sharing the key principles and practices you will need to master to start living fully in the flow and experience how effortless, abundant and free your life can become.  People who master the art of living in flow often feel as if the universe is conspiring in their favor as everything they want and need to be successful, grow and live a truly extraordinary life begins to come to them effortlessly and in perfect synchronicity.  Once you have experienced it, there is no other way to live.\r\n\r\nExpect to walk away having integrated a deep understanding of:\r\n\r\n+ What the flow is and how to identify the choices and actions which will you bring into alignment with it\r\n+ How to create exponential success and growth in your life and business from a place of effortlessness and flow\r\n+ Techniques for accessing and getting in touch with your intuition and inner wisdom for crystal clear guidance on which path will be the most effortless and fulfilling for you\r\n+ How to let go of struggle, suffering and the fear of surrendering control to the wisdom of life and move into a profound place of trust\r\n+ Simple but powerful practices to be able to call in whatever support and resources you need to further your journey of expansion, personal and spiritual growth and be successful living your passion and giving your gifts to the world\"",
