        "title": "Shamata and Walking Meditation",
        "uid": "2qmyZMEQfX2uYMKKBqoo",
        "description": "Bring your neurotic mind, tame it, and go enjoy your burn having a sense of who the fuck you really are. Connect with your true grounded self.\r\n\r\nI have practiced this meditation by myself for about 2 years. I am curious to see how this will work in a group setting as this would be a new experience for me. It is an open-eye meditation technique that focuses on the breath while also taking in your surroundings. The walking meditation focuses on the sensation your feet feel while walking at a slow place in a small circle. This practice helps form a connection with the earth as a sense of grounding. With practice, this technique helps one discover who they really are, not who they feel they are supposed to be. It has done wonders for me and truly changed my life. The instructions are very brief and basic and each person's experience is unique.",
