        "uid": "UFkPtwXzj2AvD6dDvjzz",
        "description": "Adam Eidinger spills the beans on organizing creative direct action as an art form. A leader in the camp Refoamation, Adam's philosophy of Phrygianism combines citizen action, psychedelics and civil defense.  In 2014 Adam legalized marijuana in Washington, DC and will talk strategy.  He'll also speak about the Liberty Cap and its role for thousands of years connecting liberation struggles since Roman times as well the to cap's connection to psychedelic spirituality in the Mithra tradition\r\n\r\nAdam has been arrested 18 times fighting for justice in the Belly of the Beast, Washington, DC.  He is the social action director for Dr. Bronner's Magic Soaps and is the foam OG who first set up the magic foam at Burning Man with Kris Bronner in 2009.  Since then he's helped lead the Dr. Bronner' camp (called Refoamation in 2016) as it has expanded its perfoaming activities.  Adam has been making creative plans for major protests since 2000.  His talk will reveal practical tips and advice for anyone activist or non-activist.  Adams lives by the creed of Ralph Nader who once said, \"If you don't turn onto politics, politics will turn on you.\"",
