        "description": "A deep dive into death, suffering and challenging fate through simple physical practices - opening the heart and accepting what life has to give.\r\nIn many cultures death is seen as the unknown, the point at which it is difficult to determine what happens next. Will death be the end of life? The pain experienced in the lead-up to death or the manner death is portrayed may have lasting impressions on how we determine our own death. If death is a passage and a natural step, like a leaf that falls and disintegrates into the earth, how do we best prepare to be ready, at a moments notice to fall onto earth, without a shred of remorse, guilt or unpacked potential? This workshop is about giving yourself a chance to look deeper into death with a clean slate. Determine your own method to prepare for death and live life with an openness to dying. The heart-opening exercises are done alone, and with the group using resonance tuning, energy-centering and creative visualisation. Raise your consciousness!  with Tia Kansara",
        "event_type": {
            "id": 3,
            "label": "Class/Workshop",
            "abbr": "work"
        },
