        "uid": "2VJJoVbgiSgT8vCMWYpc",
        "description": "We are a group of artisans who travel incognito while instructing others in the fine art of making masks, anatomy illustration, & other indulgences. We have our own metal stamp label that we use to \"mark\" our handiwork.Our masks are the finest in the region & our artists have the flare of Leonardo.\r\n\r\nIn the spirit of Carnivale, our menagerie started creating masks & providing instruction on how to create them. As our group increased, so did our artisan base to include painters & sketch artists. We plan to have classes in making & decorating masks along with art classes in anatomy & anything inspiring to those attending.We will have live models to help with inspiration.We will have a plexiglas panel for instruction and colouring.\r\n\r\nArt classes will be held daily ranging from anatomy to landscapes, with live models or use of the plexiglas wall as a template.\r\n\r\nThe Plexiglas wall will be available at all times with markers to color on one side while the design is created on the other.A participant can take a picture of the creation to later print and add to their coloring book.\r\n\r\n\r\nOur Artisan Menagerie is thrilled to provide the joy of creative expression mixed with various mediums from plexiglas to foam to paper.",
