        "uid": "wDuu9PowPTw9vg5iwSnR",
        "description": "Psycho-physical awakening exercises from different traditions to feel out her vibratory field.\r\n\r\nOpen yourself to the possibility of living the paradox of being joyfully alive in this tangible realm we live in while at the same time being liberated and awakened in this body.  We as humans are microcosms of this universe, whatever exists in the outer universe also exists within. Feel the vibrations of this tangible Earth we live in knowing that everything is in motion and nothing rests. Tantra is a system so intuitive and natural to human kind that its essence can be seen within all spiritual paths from the Celtic, African, Native American, Sufi, esoteric Christian, Hindu, Sound Healing, Kabbalah, Buddhist, and Taoist wisdom traditions. It is a set of spiritual practices and ritualistic actions that through personal effort and experimentation are designed to direct universal energies of the macrocosm into the practitioner to achieve total liberation from ignorance and suffering. In this workshop we will use a myriad of psycho-physical exercises learned from different traditions for modifying and exploring consciousness. We will feel the energy of the Earth and learn to appreciate this vibratory field we exist in. with Ashleigh Rojas",
