        "uid": "7ch4ZF9TEkQq8rCFEmSs",
        "description": "Start your evenings with the most intense laughter you can experience. We laugh for no reason, other than for exercise, and health. Relieve stress and pain, promote natural healing, and create spontaneous bonds of friendship through group laughter. It\u2019s fun! The brainchild of Dr. Madan Kataria in India and practiced by millions worldwide, Laughter Yoga combines Unconditional Laughter with Yogic Breathing (Pranayama). Anyone can Laugh for No Reason, without relying on humor, jokes or comedy. Laughter is simulated as a body exercise in a group; with eye contact and childlike playfulness, it soon turns into real and contagious laughter. \u201cInappropriate\u201d Laughter Yoga is also a possibility, if our clientele are okay with it. The concept of Laughter Yoga is based on a scientific fact that the body cannot differentiate between fake and real laughter. One gets the same physiological and psychological benefits. Find much more info online by searching on Laughter Yoga, but come! Enjoy!",
