        "uid": "vzouXLUgR5JNZKh3NGyQ",
        "description": "If you are a fan of Joseph Campbell, Jean Houston, Clarissa Pikola Estes...this will be right up your alley. \r\n\r\nThis is a live storytelling event where together, we explore the mythic landscape that is living in our unconscious. Through the combination of exploring the symbols, archetypes, metaphors that show up in the one of a kind story created in our time together, you are provided context and tools to explore the power and potential of your story and how to use it to access and embody the parts of you that may be lying dormant. People have requested stories that will heal, provide insight about their gifts, and help them access their personal power. \r\n\r\nWhat to expect from A Soul Story Circle: When we gather in a circle, one person is chosen to receive a story that will serve all. We then go through a process called talking back to the story, where we make sense of the symbols, metaphors, and archytpes that presented and how they apply to our every day lives.",
