        "description": "* Cartooning is a powerful art-form that can entertain and influence, but is simple to learn and accessible to all.  Rock painting is a fun, relaxing, and enjoyable pastime. Wed, Sat: 2-4PM.\r\nCome learn from a professional cartoonist to practice this expressive and enjoyable skill.\u00a0 All skill levels welcome; you do not need to have any prior training or experience.\u00a0 Learn all the basic skills like character creation, layout, composition, perspective, and comedy writing.\u00a0 Brush up on advanced techniques like human and animal figure drawing, proportion, and color.\u00a0 We end with an improvisational art game using the cartooning skills we've learned.\u00a0 Supplies provided, or bring your own.\r\n* Forged out of the eons of Deep Time and raw forces of Nature, a uniquely shaped and smoothed river stone awaits your unique curiosity in an ephemeral moment of creative exploration. We supply you with the stone, paint and guidance; you supply your awareness, vision, and imagination. Together on your planetary journeys, after 4.5 billion years you and the river stone meet. Silly or profound, the colors or imagery are all a part of the play on the Playa. Will your rock become a bug, a power object, a flower, or a psychedelic paisley? Experienced art teachers can help with color mixing, brush technique, and concept execution. Create a memory to keep or offer as a gift. Thurs: 3-5PM.",
