        "description": "We invite participants - especially folks wearing wings, and friends - to gather at the temple on the Sunday of Temple Burn in the hour before dawn (around 5:30-6 AM), to circle the temple in solemn procession as the sun rises around 6:30 AM.  Let's aim for ~15-20 minutes of procession, followed by any additional participation with the Temple you choose. Afterwards we will scatter to share the spirit & purpose of this year's temple.\r\n\r\nIn perihelion to this event, some of us winged folk will gather again for a night-time circling of the temple, at midnight after the temple burn, around the ashes of the Temple.\r\n\r\nNote: The Temple Guardians enthusiastically anticipate this participation, and only ask that we be prepared for them to begin the soft-close of the temple around dawn on Sunday, followed by the firm closure by 8 AM. Parking bikes >500' away from the Temple is requested if you want to stay in the area past 8 AM.\r\n\r\nhttps://walkofthewings.wordpress.com/home",
