        "uid": "ADFYazYu9d93rnMAsnbi",
        "description": "It is our pleasure to host you at Slippery Vulvas! Today we'll be carving beautiful and varied vulvas out of pink soap in this live workshop space open to all genders. Promoting eye-opening (and leg-opening) dialogue on the many different forms of this tucked away treasure. We're talking innies, outties, bald vulvas, hairy vulvas, groomed vulvas, asymmetrical vulvas, layered vulvas, big vulvas, small vulvas . . . just like a fingerprint no two can ever be the same! The assortment really is amazing.\r\n\r\nInspired by Australian artist Greg Taylor's exhibition entitled The Great Wall Of Gina displaying 151 life size porcelain sculptures along a 130ft wall at the MONA in Hobart, Australia. In the gift shop of the museum they sell soaps that are a replica of these moulds, but on Playa we will be the artists! \r\n\r\nWho will be your muse?",
