        "uid": "C9Bun9YhWnhxRWzQz4nE",
        "description": "Our theme camp work shop includes bua-buei ,message ,talisman and fortune stick.\r\nBua buei\"\r\nBua-buei means throwing divine blocks.\r\nBuei blocks are very common divination tools in Taiwanese temples,which are used in pairs and thrown to get a yes or no answer from gods.\r\nThey are made out of wood and carved into a crescent shape.Each block is round on one side (known as the Yin side) and flat on the other (known as the Yang side).\r\nWhen throwing the blocks, there are three possible results: One block flat and another block round is a \u2018yes\u2019 answer.Both blocks flat is a \u201cmaybe\u201d answer. Both blocks round is a \u2018no\u2019 answer.\r\n\u200b\r\n\"Fortune Sticks\"\r\nDuring a ritual, the querent will light an incense,\r\nBua-buei and accompanied by drawing fortune sticks to clarify an oracle.\r\n\u200b\r\n\"Talisman\"\r\nWe will use talismanic stamp or giving an amulet to participant for good health and good luck.\r\nThe participant can get inked by a  Burning Mazu talismanic stamp, then enter ouracupressure massage dome.",
