        "uid": "tjiLTzTgoQn979Q4mti8",
        "description": "We invite you to this workshop wedding, a wedding ceremony in real time, vows in conversation. \r\n\u3000\u3000\r\nBe witnesses and contributors to a dialogue that began with a question: Can a couple be more free together than they can be apart?  To answer this it was necessary to find a new comprehension.  And we found a way that we call Copassion \u2014 our employer, a permanent workshop, a commitment to listen, follow change, a hermetic container for creation. \r\n\u3000\u3000\r\n#clothing optional #nudist #naturist",
